import React from "react";
import { Link } from "react-router-dom";
import "./NextPageLink.css";

const NextPageLink = props => (
	<div className="bottom-0 position-relative right-0">
		<Link className={ "color-inherit padding-left-p1em padding-right-p1em a-color-scheme-" + props.colorSchemeSuffix } to={ props.urlPath }>Next Page</Link>
	</div>
);

export default NextPageLink;
